    [CascadingParameter] public IModalService Modal { get; set; }
    [CascadingParameter] private Task<AuthenticationState> authenticationStateTask { get; set; }
    public GMINWEB_Rebuild.Pages.Common.ConfirmBase DeleteConfirmation { get; set; }
    public int MenuId = 32;     //매장별 재고현황

    ClaimsPrincipal CurrentUser;
    private List<InventoryModel> pditemModels;
    private List<InventoryModel> itemModels;

    private string RoleYN;
    private string loginId;

    protected override async Task OnInitializedAsync()
    {
        //로그인을 한 사용자인지
        if (authenticationStateTask is not null)
        {
            CurrentUser = (await authenticationStateTask).User;

            //사용자 정보가 있는지
            if (CurrentUser.Identity.Name is not null)
            {
                var RoleList = await _RoleManager.GetRoleYN(CurrentUser.Identity.Name, MenuId);
                RoleYN = RoleList.FirstOrDefault().ReadWrtYN;

                loginId = CurrentUser.Identity.Name;

                //조회권한이 있는지
                if (RoleYN == "Y")
                {
                    //제품 재고 현황 조회
                    pditemModels = await _db.GetStorePDItemInventory(loginId);

                    //품목 재고 현황 조회
                    itemModels = await _db.GetStoreItemInventory(loginId);
                }

            }
        }
    }


